INSERT INTO `ko_cloudbeds_hotels` VALUES (1,170048,'8 Days Boutique Hotel','https://h-img2.cloudbeds.com/uploads/170048/l1008445_gallery~~5d0a7055153f3.jpg','https://h-img3.cloudbeds.com/uploads/170048/l1008445_thumb~~5d0a705555401.jpg','30013661','8dayshotelhk@gmail.com','10/F & 16/F, Kingland Apartments','739 Nathan Road','Mongkok','Hong Kong','000000','HK','22.32138062','114.17259979','14:00','11:00',0,'percent','50.00','','Baggage storage,Elevators','<div><div><span><br>Well-placed in the restaurants, shopping, nightlife area of Hong Kong city,&nbsp;8 Days Boutique Hotel&nbsp;provides a most conducive spot for you to take a break from your busy days. Only 31.6 Km away, this 1-star hotel can be easily accessed from the airport. With its convenient location, the hotel offers easy access to the city\'s must-see destinations.<br><br>8 Days Boutique Hotel&nbsp;also offers many facilities to enrich your stay in Hong Kong. While lodging at this wonderful property, guests can enjoy free Wi-Fi in all rooms, 24-hour security, express check-in/check-out, luggage storage, Wi-Fi in public areas.<br><br>8 Days Boutique Hotel&nbsp;is home to 16 bedrooms. All are tastefully furnished and many even provide such comforts as television LCD/plasma screen, internet access – wireless (complimentary), non smoking rooms, air conditioning, blackout curtains. Besides, the hotel\'s host of recreational offerings ensures you have plenty to do during your stay.&nbsp;8 Days Boutique Hotel&nbsp;is a smart choice for travelers to Hong Kong, offering a relaxed and hassle-free stay every time.</span><div><br></div><div></div></div></div>','Asia/Hong_Kong','HKD','$','before',0,2),(2,173267,'Chung King Hotel','','','+852888888','chungkinghotel1234@gmail.com','11/A, Kingling Mansion 739 Nathan Road, Kowloon, Hong Kong','','Hong Kong','','','HK','22.32888031','114.18920135','14:00','12:00',0,'percent','50.00','','Baggage storage,Elevators,Ticket and Tour','','UTC','HKD','$','before',0,0),(3,173691,'