g Kong, according to independent reviews. This area is also great for shopping, with popular brands nearby: Rolex, Cartier, Tiffany &amp; Co, Gucci, Louis Vuitton.</div><div><br></div>','Asia/Hong_Kong','HKD','$','before',0,1),(5,172067,'Cozy Hostel','','','85252414566','cozyhostel123@gmail.com','Flat 7, 2/F, Hai Phong Mansion,','101 Nathan Road, Tsim Sha Tsui','Hong Kong','','Hong Kong China','HK','23.23043060','97.66118622','14:00','11:00',0,'percent','50.00','','Baggage storage,Elevators','\nCozy Hostel is 3 minutes walk from Tsim Sha Tsui MTR exit A1,\nlocated a 5-minute walk from Avenue of Stars, half a kilometer from Victoria\nHarbor and a 10-minute walk from Tsim Sha Tsui Star Ferry Pier. \n\n&nbsp;\n\nThe 1-star guesthouse has air-conditioned rooms with a private\nbathroom and free WiFi. \n\n&nbsp;\n\nPopular points of interest near the accommodation include iSquare,\nHarbour City and Mira Place 1.\n\n<br><br><br><br><br>','Asia/Hong_Kong','HKD','$','before',2,1),(6,175387,'Fu Yong Hotel','','','8528888888','fuyungkoalabeds@gmail.com','Flat A, 3/F, Kingland Apartments,','739 Nathan Road, Mong Kok, Kowloon.','Hong Kong','Hong Kong','Hong Kong','HK','22.28552055','114.15769196','14:00','12:00',0,NULL,NULL,'','','','Asia/Hong_Kong','HKD','$','before',0,1),(7,26846,'Granduer Holiday Hotel','https://h-img1.cloudbeds.com/uploads/26846/triple_person_room_1_gallery~~5cf8d49fed5ca.jpg','https://h-img2.cloudbeds.com/uploads/26846/triple_person_room_1_thumb~~5cf8d4a039e2a.jpg','2688 8169','grandeurholidayhotel1@gmail.com','737 Nathan Road Hong, Mongkok','Flat A-D, Floor 2, Kingland Apartments,','Kowloon','Hong Kong','000000','HK','22.32168770','114.16901398','14:00','11:00',0,'percent','50.00','','Baggage storage,Elevators','Grandeur holiday hotel managed by Koalabeds Group is one of our established property. Located in 737 Nathan Road it is 5 minutes from MTR.<br><br>The property is known for having extremely large rooms and is all on one floor. Perfect for foreigners