plasma screen, internet access – wireless, internet access – wireless (complimentary), air conditioning, television. Besides, the hotel\'s host of recreational offerings ensures you have plenty to do during your stay. Enjoy unparalleled services and a truly prestigious address at the&nbsp;Ho Yuen Hotel.</span><div><br></div><div></div></div></div>','Asia/Hong_Kong','HKD','$','before',0,1),(9,164638,'Kamdo Hotel','https://h-img2.cloudbeds.com/uploads/164638/l1005602_gallery~~5cf0a9a590778.jpg','https://h-img3.cloudbeds.com/uploads/164638/l1005602_thumb~~5cf0a9a5c573c.jpg','24589000','kamdohotel2019@gmail.com','Flat 1, 4/F, Alhambra Building, 385 Nathan Road, Yau Ma Tei, Hong Kong, Hong Kong','','Hong Kong','Hong Kong','92103','HK','22.31012726','114.17121887','14:00','12:00',0,'percent','50.00','','Elevators','Kam Do Guest House managed by Koalabeds Group<span>&nbsp;is a new hotel just start operating in 2013 with very grand decoration in the Yau Ma Tei/ Jordan district. Living experience will be so much different from those cheap and crappy old style small hostels in same area. Kam Do Guest House located right next to tourist attraction such as Temple Street, Electrical Street and many shopping malls. There are also many different restaurants, banks, shops and convenience stores within walking distance of the building making it a prime location to stay. Now Kam Do is under the Koalabeds Brand.&nbsp;<br></span><br>Kam Do Guest House&nbsp;<span>has many rooms with different sizes to suit your every need. Room type includes single room (one double bed), double room (one double bed), twin room (two single beds), Triple room (one double + one single beds) and Quattro room (two king sized beds). The luxury room facilities is similar to hotel rooms of three stars hotels making it the most value for money stay you can get in Yau Ma Tei / Jordan area (hotel room with same facilities can cost you over thousand dollar per night）. The purpose of having such nicely decorated room is to cater for those travelers who is concern with their comfort and safety with their accommodation, but yet having a tight budget in spending excessive money in star rated hotel rooms. Therefore Kam Do Guest House is always very busy with tourist from worldwide so booking a room well in advance is advisable.<br></span><br>Kam Do Guest House&nbsp;Provides<br>24 hrs Staffed<br>Free local calls<br>Free Fridge &amp; hot water<br>Free WiFi Internet access<br>Free hairdryer<br>Air-conditioned Room<br>Free Drinking Water<br>Free Kettle<br>Each room has its own toilet, hot shower and air-conditioner. Hostel also provide free body/hair shampoo, towels, tooth brush/paste, slippers, hair dryer for your convenience. The fire prevention facilities are fully complies with government\'s requirements, making your stay a very safe one.&nbsp;<br><br>Kamdo Guest House is part of the Koalabeds Group, please visit <a href=\"http://www.koalabeds.com.hk\">www.koalabeds.com.hk</a>&nbsp;for more guesthouses and direct bookings. Best price guarantee!','Asia/Hong_Kong','HKD','$','before',1,1),(10,171327,'Koalabeds H36','','','+852 5175 8448','embassyh36@gmail.com','240-252 Nathan Road','','Hong Kong','Hong Kong','','HK','22.30513000','114.17194366','14:00','11:00',0,'percent','50.00','','Baggage storage,Elevators','EmbassyH36 managed by Koalabeds Group&nbsp;is a 9 rooms property in National Court.&nbsp;<br><br>Ideally\n set in the Yau Ma Tei district of Hong Kong, EmbassyH36  is located \n1.2 miles from Tsim Sha Tsui Star Ferry Pier, 1.2 miles from Avenue of \nStars and a 17-minute walk from Kowloon Park.&nbsp;... All rooms in EmbassyH36 <span> are equipped with a flat-screen TV and a hair dryer.<br></span><br>EmbassyH36 is an excellent choice for travellers visiting Hong Kong, offering \nmany helpful amenities designed to enhance your stay. While staying at \nEmbassyH36, visitors can check out Sandbox VR (0.8 km) and Tsim Sha \nTsui Promenade (1.2 km), some of Hong Kong\'s top attractions. Guest \nrooms offer air conditioning, and EmbassyH36  makes getting online easy \nas free wifi is available. You can also take advantage of some of the \namenities offered by the motel, including a concierge and baggage \nstorage. If you’re looking for a Spanish restaurant, consider a visit to\n The Optimist, 22 Ships, or Chullschick, which are all conveniently \nlocated a short distance from EmbassyH36. If you’re looking for things \nto do, you can check out Hong Kong Skyline (1.4 km), Victoria Harbour \n(1.2 km), or Sky100 Hong Kong Observation Deck (1.2 km), which are \npopular attractions amongst tourists, and they are all within walking \ndistance. Enjoy your stay in Hong Kong!<br><br>Please visit&nbsp;<a href=\"http://www.koalabeds.com.hk/\" target=\"\" rel=\"\">www.koalabeds.com.hk</a>&nbsp;for more guesthouses and direct bookings. Best Price Guarantee!<br><br><br><br><br><br><br><br>','Asia/Hong_Kong','HKD','$','before',2,1),(11,169763,'Lee Garden Guest House','','','+85223672284','starguesthouse@gmail.com','7 and 8 Floor, 34-36 Cameron Road','','Hong Kong','Hong Kong','000000','HK','22.29924965','114.16851807','14:00','12:00',0,'percent','50.00','','Baggage storage,Concierge desk,Elevators,Welcome Drink,Non-Smoking Rooms,24-Hour Porterage,24-Hour Reception,Wi-Fi Access,Lift/Elevator,Street Parking','<div>Nestled in the heart of Tsim Sha Tsui, Lee Garden Guest House is an ideal spot from which to discover Hong Kong. From here, guests can enjoy easy access to all that the lively city has to offer. A well-kempt environment and its proximity to Tsim Sha Tsui East, Queen\'s Road East, Consulate of Senegal give to this hotel a special charm.<br></div><div><br></div><div>Lee Garden Guest House also offers many facilities to enrich your stay in Hong Kong. Guests of the hotel can enjoy on-site features like free Wi-Fi in all rooms, 24-hour security, express check-in/check-out, luggage storage, Wi-Fi in public areas.&nbsp;</div><div><br></div><div>Experience high quality room facilities during your stay here. Some rooms include television LCD/plasma screen, carpeting, clothes rack, linens, locker, provided to help guests recharge after a long day. Besides, the hotel\'s host of recreational offerings ensures you have plenty to do during your stay. Superb facilities and an excellent location make the Lee Garden Guest House the perfect base from which to enjoy your stay in Hong Kong.</div>','Asia/Hong_Kong','HKD','$','before',1,1),(12,164632,'Mei Mei Motel','https://h-img2.cloudbeds.com/uploads/164632/_dsc3444_gallery~~5cf0a70237f47.jpg','https://h-img3.cloudbeds.com/uploads/164632/_dsc3444_thumb~~5cf0a7027f44c.jpg','+852 9845 2666','meimeimotel@yahoo.com.hk','3rd Floor, 83 Argyle Street','','Mongkok','Hong Kong','00000','HK','22.32138062','114.17259979','14:00','12:00',0,'percent','50.00','','Baggage storage,Elevators','<span><span><span>Mei Mei Motel managed by Koalabeds Group is located at the shopping area in MongKok (Kowloon Side), we got brand new deluxe rooms, and full equipment is available, such as TV, Wireless Internet Service, Private Bathroom and etc. And it is so easy to get to us, cos our location is very near to different public transportation station, such as MTR station, Train Station, Airport Bus Station and etc. We got passionate staff to serve you, and we are looking forward to see you all !<br><br>Mei Mei Motel is one of the longest standing guesthouses for over 20 + years and previously was run by sisters. Mei Mei Motel is now under the Koalabeds brand.&nbsp;<br><br>It is a 5 mins walk away from Ladies Markets, Langham Place, and The One.&nbsp;<br><br>Please visit <a href=\"http://www.koalabeds.com.hk\">www.koalabeds.com.hk</a>&nbsp;for more guesthouses and direct bookings. Best Price Guarantee!</span></span></span>','Asia/Hong_Kong','HKD','$','before',2,1),(13,28565,'Qianyue Inn','https://h-img1.cloudbeds.com/uploads/28565/l1003657_gallery~~5cf0e960410aa.jpg','https://h-img2.cloudbeds.com/uploads/28565/l1003657_thumb~~5cf0e9607abd8.jpg','5175 8448','qianyueinn2018@gmail.com','3G, 500 Nathan Road','','Hong Kong','Hong Kong','000000','HK','22.29924965','114.16851807','14:00','11:00',0,'percent','50.00','','Baggage storage,Concierge desk,Elevators','Qian Yue inn managed by Koalabeds Group&nbsp;is a 30 room property in New Lucky Guesthouse.&nbsp;<br><br>Ideally set in the Yau Ma Tei district of Hong Kong,&nbsp;Qian Yue Inn&nbsp;is located 1.2 miles from Tsim Sha Tsui Star Ferry Pier, 1.2 miles from Avenue of Stars and a 17-minute walk from Kowloon Park.&nbsp;... All rooms in&nbsp;Qian Yue Inn<span>&nbsp;are equipped with a flat-screen TV and a hair dryer.<br></span><br>Qianyue Inn is an excellent choice for travellers visiting Hong Kong, offering many helpful amenities designed to enhance your stay. While staying at Qianyue Inn, visitors can check out Sandbox VR (0.8 km) and Tsim Sha Tsui Promenade (1.2 km), some of Hong Kong\'s top attractions. Guest rooms offer air conditioning, and Qianyue Inn makes getting online easy as free wifi is available. You can also take advantage of some of the amenities offered by the motel, including a concierge and baggage storage. If you’re looking for a Spanish restaurant, consider a visit to The Optimist, 22 Ships, or Chullschick, which are all conveniently located a short distance from Qianyue Inn. If you’re looking for things to do, you can check out Hong Kong Skyline (1.4 km), Victoria Harbour (1.2 km), or Sky100 Hong Kong Observation Deck (1.2 km), which are popular attractions amongst tourists, and they are all within walking distance. Enjoy your stay in Hong Kong!<br><br>Please visit&nbsp;<a href=\"http://www.koalabeds.com.hk/\" target=\"\" rel=\"\">www.koalabeds.com.hk</a>&nbsp;for more guesthouses and direct bookings. Best Price Guarantee!<br><br>','Asia/Hong_Kong','HKD','$','before',1,1),(14,172974,'Resort M - BTS Chong Nonsi','https://h-img3.cloudbeds.com/uploads/172974/203907746_gallery~~5d7899022a57d.jpg','https://h-img1.cloudbeds.com/uploads/172974/203907746_thumb~~5d789902571f5.jpg','064456168','resortmchongnonsi@yahoo.com','37/14 Silom Soi 9 Silom, Bang Rak, Bang Rak, Bangkok, Thailand','','Bangkok','','10500','TH','13.73330021','100.53330231','14:00','12:00',0,'percent','50.00','','Baggage storage,Concierge desk,Printer,Safe deposit boxes at front desk,Swimming pool,In-Room Safety Deposit,Wi-Fi in Public Area,In-Room Wi-Fi,Parking,Airconditioned Rooms,Airport Transfers','Attractively situated in the Bang Rak district of Bangkok, Resort M - BTS Chong Nonsi is located 3.8 km from Bangkok Art &amp; Culture Centre, 4 km from Gaysorn Shopping Mall and 4 km from MBK Center. This 3-star hotel offers a 24-hour front desk and free WiFi. The property is non-smoking and is situated 3.5 km from Lumpini Park. The rooms are fitted with air conditioning, a flat-screen TV with cable channels, a fridge, a kettle, a bidet, free toiletries and a desk. At the hotel, rooms have a wardrobe and a private bathroom.&nbsp;<span>CentralWorld is 4.1 km from Resort M - BTS Chong Nonsi, while The Jim Thompson House is 4.4 km from the property. The nearest airport is Don Mueang International Airport, 27 km from the accommodation.</span>','Asia/Bangkok','THB','฿','before',2,1),(15,173694,'Simply Hostel Koala Beds','','','852888888','simplyhostelkoalabeds@gmail.com','Flat H, 11/F, New Lucky House, 15 Jordan Road, Jordan, Kowloon.','','kowloon','','852','HK','22.30517578','114.17188263','14:00','12:00',0,'percent','50.00','','Elevators','good','UTC','HKD','$','before',2,1),(16,173747,'The Anglo Chinese Guest Hotel','https://h-img2.cloudbeds.com/uploads/173747/l1000421_gallery~~5d8b07c2a6380.jpg','https://h-img3.cloudbeds.com/uploads/173747/l1000421_thumb~~5d8b07c2d0cdb.jpg','852888888','theanglokoalabeds@gmail.com','Flat G & H, 13/F Lucky House,','15 Jordan Road','Hong Kong','Hong Kong','Hong Kong','HK','22.27662277','114.17642975','14:00','12:00',0,'percent','50.00','','Baggage storage,Elevators','<div>The Anglo Hotel is located in Jordan Yau Ma Tei district in Kowloon, in the hustle and bustle of the city and around the corner for all forms of public transportation. Situated on the “Golden Mile” of Hong Kong allows easy access to nearby attractions: the Temple Street Night Market,&nbsp;Jade Market,&nbsp;Ladies’ Market,Victoria Harbour&nbsp;and the&nbsp;Star Ferry are all within walking distance.<span> <br></span></div><div><span><br></span></div><div><span>A 5-minute walk along Nathan Road towards Tsim Sha Tsui is Kowloon Park, the largest park in Kowloon; an approximately 15-minute walk will take you to the shopping paradise of Tsim Sha Tsui stretching from The One to iSquare and Ocean Terminal, while our famous Hong Kong Cultural Centre for performances and exhibitions is also en route.</span></div>','Asia/Hong_Kong','HKD','$','before',2,1),(17,172189,'Yue Ka Hotel','https://h-img2.cloudbeds.com/uploads/172189/yk_corridor_gallery~~5d58344d55a99.jpg','https://h-img3.cloudbeds.com/uploads/172189/yk_corridor_thumb~~5d58344d7929d.jpg','+852 5241 4566','yuekanew2019@gmail.com','(Reception @ 2/F, Spanish Hotel) 5/F, 99 Argyle Street','Mongkok','Hong Kong','','00000','HK','22.28552055','114.15769196','14:00','12:00',0,'percent','50.00','','','\r\n\r\n<span>Situated in Mong Kok, this hotel is within walking distance of\r\nLangham Place and Canton Road. It is close to Ladies Market, dining options and\r\nshops. <br>\r\n<br>\r\nYue Ka Hotel has been recently refurbished and offers free Wi-Fi, an express\r\ncheck-in and check-out feature and luggage storage. <br>\r\n<br>\r\nRooms at Yue Ka Hotel are comfortable and provide cable/satellite channels.\r\nAfter settling in to their room, guests can discover the area with use of Mong\r\nKok MTR Station exit D2, which is within a five-minute walk of the hotel. <br>\r\n<br>\r\nYue Ka Hotel is conveniently situated for sightseeing in the area with Fa Yuen\r\nStreet just a couple of minutes away. The Yaumati Theatre and Mong Kok Stadium\r\nare each within walking distance.</span>\r\n\r\n<br><br><br><br>','Asia/Hong_Kong','HKD','$','before',2,1),(18,172068,'Zixin Motel','','','85252414566','zixinmotel@gmail.com','Flat 11, 8/F, Hai Phong Mansion','101 Nathan Road, Tsim Sha Tsui, Kowloon','Hong Kong','','','HK','22.28552055','114.15769196','14:00','11:00',0,'percent','50.00','','Baggage storage,Elevators,Laundry service','\n<div>~Zi Xin Motel is one of the newest hotels in Hong Kong, renovated in\n2017. With Hong Kong West Kowloon Railway Station just 2km away and Hong Kong\nInternational Airport only 35km away, transportation is very convenient. \n\n&nbsp;\n\n<br></div><div>~Being just minutes away from Tsim Sha Tsui MTR exit A1\n\n&nbsp;&nbsp;<br></div><div>Famous local attractions Hong Kong Avenue of Comic Stars, The\nPeninsula Spa (Peninsula Hong Kong), can all be reached with a short walk.\n\n</div><br><br><br><br>','Asia/Hong_Kong','HKD','$','before',0,0),(19,173270,'Lucky Hostel','','','852888888','luckyhostelkoalabeds@gmail.com','Flat B&G, 10/f ,kingland building, 737-741 nathan road, mong kok kowloon, hong kong','','mong kok','','852','HK','-27.55887985','153.06230164','14:00','12:00',0,'percent','50.00','','Elevators,Ticket & Tour','good','Asia/Hong_Kong','HKD','$','before',2,1);
