INSERT INTO `ko_cloudbeds_hotels_cn` VALUES (1,19,173270,'星光旅馆','<p>星光旅馆毗邻九龙的旺角。如果您的日程安排包括购物，弥敦道购物区和旺角电脑中心绝对值得一逛，若想欣赏自然景观，可以探索花墟公园和九龙公园。前往热门景点，可以参观香港动植物公园和山顶缆车。</p><p>这家无烟酒店提供24 小时前台服务和公共区域免费 WiFi。 所有 7 间客房提供免费 WiFi、纯平电视，以及淋浴设施。</p><p>步行 港铁旺角站 - 3 分钟<br>旺角电脑中心 - 步行 7 分钟<br>女人街 - 步行 7 分钟<br>天际 100 - 车程 3 分钟<br>环球贸易广场 - 车程 3 分钟<br>九龙公园 - 车程 4 分钟<br>香港(HKG-香港国际机场) - 23 分钟车程</p>','Flat B&G, 10/f ,kingland building, 737-741 nathan road, mong kok kowloon, hong kong'),(2,10,171327,'H36 Motel','<p>H36 Motel位置很赞，位于香港的油尖旺区，距离美丽华广场一期有7分钟步行路程，距离美丽华广场二期有600米，距离九龙公园有15分钟步行路程。这家实惠型旅馆提供带私人浴室和免费WiFi的空调客房。这家住宿距离海港城有1.8公里，距离iSQUARE国际广场有1.8公里。</p><p>这家旅馆的房间均配备平板电视。</p><p>H36 Motel附近的热门地标包括尖沙咀天星码头、圆方购物中心和星光大道。</p><p>旅友们喜爱油尖旺区的理由：购物、奢侈品牌购物和观光。</p><p>根据我们网站上的真实住客点评，这里是香港的人气地区之一。 购物超赞！周边商店：Rolex、 Cartier、 Gucci、 Tiffany &amp; Co、 Louis Vuitton</p>','九龙佐敦弥敦道242号立信大厦3字楼H室, 油尖旺区'),(3,18,172068,'紫韾賓館','<span lang=\"zh-CN\" tabindex=\"0\">Zixin Motel 旅馆位于尖沙咀的中心地带，毗邻公园，国际广场和b1尖沙咀的豪宅。 舒适旅馆距离维多利亚港不到1公里，距离尖沙咀天星码头有10分钟的步行路程，距离国际广场有1.3公里。这家一星级旅馆的空调客房设有私人浴室和免费无线网络连接。酒店禁止吸烟，距离星光大道有400米。 旅馆的所有客房均配有水壶。 Zixin Motel 旅馆的客房配有带卫星频道的平面电视。 住宿附近的热门景点包括海港城，Mira Place 1和Mira Place 2。 油尖旺区是购物，奢侈品牌购物及购物服装的旅客的绝佳选择。</span>',''),(4,16,173747,'金山酒店','<div id=\"property_description_content\"><p>金山酒店坐落于<span lang=\"zh-CN\" tabindex=\"0\">佐敦</span>，配备带空调和私人浴室的客房，所有客房均配备平板电视。距离美丽华广场一期有不到6分钟步行路程，距离美丽华广场二期有600米。</p><p>这家住宿靠近多个著名的景点，距离星光大道约1.7公里，距离海港城约1.7公里，距离iSQUARE国际广场约1.8公里。住宿提供免费WiFi。</p><p>附近的热门地标包括九龙公园、尖沙咀天星码头和圆方购物中心。</p></div><p class=\"geo_information\">油尖旺區是<span class=\"hp_district_endorsement_item\">購物</span>、<span class=\"hp_district_endorsement_item\">精品購物</span>、<span class=\"hp_district_endorsement_item\">觀光</span>的絕佳選擇。購物方便，周邊人氣品牌商店有：Rolex、 Cartier、 Gucci、 Tiffany &amp; Co、 Louis Vuitton</p>','九龍佐敦佐敦道22號鴻運大廈13字樓G&F室, 油尖旺區'),(5,15,173694,'淳一宾馆','<span lang=\"zh-CN\" tabindex=\"0\">淳一宾馆位于九龙佐敦，邻近多处香港旅游景及多个商业中心，是商务和休闲旅客的理想下榻之处。旅客不但可步行前往庙街夜市，玉器市场，女人街，维多利亚港及天星码头等多个旅游景点；更可沿弥敦道往尖沙咀方向步行5分钟至九龙区最大的公园-九龙公园。而前往多个大型购物商场如尖沙咀海运大厦、iSQUARE 国际广场、The One 和著名的香港文化中心观看表演或展览也只需步行约10分钟。\n\n酒店位于九龙市中心的 ”黄金地段”，公共运输四通八达，距离港铁（地铁）佐敦站约2分钟步程\n乘搭港铁往返维多利亚港及香港岛只需数分钟。酒店与香港会议展览中心只相隔3个港铁站，车程为大槪10 分钟，方便快捷。\n旅客前往香港国际机场，更可轻松乘搭离酒店不远的A21机场巴士，需时约30分钟。</span>','弥敦道道300号华丰大厦11楼H室, 佐敦'),(6,14,172974,'','<p>Resort M - BTS Chong Nonsi位置很好，位于曼谷的挽叻县，距离隆比尼公园有3.5公里，距离曼谷文化艺术中心有3.8公里，距离盖索恩广场有4公里。这家住宿距离MBK购物中心约有4公里，距离中央世界广场有4.1公里，距离金汤普森泰丝博物馆有4.4公里。住宿配备24小时前台以及免费WiFi。</p><p>所有客房均配有空调、带有线频道的平板电视、冰箱、电热水壶、坐浴盆、免费洗浴用品和书桌。这家酒店的部分房间享有拥有池景。客房拥有私人浴室和衣柜。</p><p>Resort M - BTS Chong Nonsi距离暹罗海洋世界有4.4公里，距离暹罗百丽宫有5公里。最近的机场是曼谷廊曼国际机场，距离这家住宿有27公里。</p>',''),(7,11,169763,'利園賓館','<p>Lee Garden Guest House旅馆位于香港，提供带免费WiFi的空调客房。 酒店距离国际广场有4分钟的步行路程，靠近九龙公园。 酒店距离星光大道有700米，距离海港城有700米。</p><p>部分客房设有带微波炉和冰箱的小厨房。</p><p>旅馆可以在前台方便地提供信息，以帮助客人游览该地区。</p><p>Lee Garden Guest House旅馆距离香港中国客运码头800米。</p><p>尖沙咀是对奢侈品牌购物，购物和购物服装感兴趣的旅客的绝佳选择。</p><p>据独立评论，这是我们客人最喜欢的香港地区。</p><p>Lee Garden Guest House旅馆由Koalabeds Group管理。</p>',''),(8,12,164632,'鎂鎂賓館','<p>镁镁宾馆位于旺角（九龙）的购物区，我们有全新的豪华客房，并提供全套设备，如电视，无线上网服务，私人浴室等。</p><p>它在宾馆行业已成立15年。我们位于旺角地铁站E2外的中心位置。</p><p><span style=\"font-size: inherit;\">我们的位置非常接近不同的公共交通站，如地铁站，火车站，机场巴士站等。我们有热情的员工为您服务，我们期待着大家见！</span></p>','旺角 亚皆老街83号 先施大厦 3楼 307室'),(9,13,28565,'千悦宾馆','<p>千悦宾馆位于佐敦的New Lucky Guesthouse，拥有30间房间。它就在佐敦港铁站的A1出口。附近有一个购物中心，该地区有很多美味的食物。千悦宾馆由Koalabeds(考拉拉集团)管理。</p><p>2分钟步行路程可以到达附近的星巴克以及许多商业和银行区。千悦宾馆亦非常靠近西九龙港铁站。</p><p>千悦宾馆位于香港，提供带免费WiFi的空调客房。这家一星级宾馆提供礼宾服务和票务服务。酒店禁止吸烟，距离美丽华商场不到一公里。</p><p>宾馆附近的热门景点包括美丽华商场，九龙公园和海港城。</p>','弥敦道300号 华丰大厦 3楼 G座'),(10,1,170048,'8天時尚精品連鎖酒店','<p>8 Days Boutique Hotel（由Koalabeds Group管理）地理位置优越，位于香港弥敦道购物区，距离女人街700米，距离Mira Place 1公寓2.8公里，距离Mira Place 2公寓2.9公里。一星级宾客 度假屋的空调客房设有私人浴室和免费WiFi。 酒店提供礼宾服务，并为客人购买门票。</p><p>旅馆的所有客房均配有平板电视和免费洗浴用品。</p>',''),(11,8,25198,'豪源酒店','<p>豪源酒店位于旺角市中心，毗邻朗豪坊和旺角站E1出口，是一家位于中心位置的优质酒店。</p><p>酒店拥有11间客房，分布在两层，经过全新装修，配有洗浴用品和基本必需品。有几个家庭房和双人客房。适合大型团体和家庭入住。</p><p><span style=\"font-size: inherit;\">酒店提供免费无线网络连接，距离I-Square国际广场有3.1公里，距离美丽华商场有2.4公里，距离朗豪坊有100米，距离女人街有0.5公里。</span></p>','旺角 奶路臣街11号 10/F 和 11/F'),(12,9,164638,'金都宾馆','<p>我们的宾馆位于弥敦道385号，有19间客房。</p><p>金都宾馆位于香港油麻地区，距离女人街有1.6公里，距离美丽华商场有1.7公里，距离九龙公园有1.8公里。这家一星级宾馆的空调客房设有私人浴室和免费无线网络连接。酒店禁止吸烟。</p><p>宾馆的每间客房都配有书桌和平面电视。 金都宾馆的客房设有休息区。距离海港城有2.3公里，距离圆方有2.3公里。 油麻地是对街头食品，便利的公共交通和当地美食感兴趣的旅客的绝佳选择。</p>','香港 油麻地 弥敦道385号 4楼 1室'),(13,2,173267,'鸿京酒店','<p>鸿京酒店毗邻九龙的旺角。如果您的日程安排包括购物，弥敦道购物区和旺角电脑中心绝对值得一逛，若想欣赏自然景观，可以探索花墟公园和九龙公园。前往热门景点，可以参观香港动植物公园和山顶缆车。</p><p>这家无烟酒店提供24 小时前台服务和公共区域免费 WiFi。 所有 7 间客房提供免费 WiFi、纯平电视，以及淋浴设施。</p><p>步行 港铁旺角站 - 3 分钟<br>旺角电脑中心 - 步行 7 分钟<br>女人街 - 步行 7 分钟<br>天际 100 - 车程 3 分钟<br>环球贸易广场 - 车程 3 分钟<br>九龙公园 - 车程 4 分钟<br>香港(HKG-香港国际机场) - 23 分钟车程</p>',''),(14,3,173691,'金怡酒店 - Koala Beds','<span lang=\"zh-CN\" tabindex=\"0\">金怡酒店位于九龙佐敦，邻近多处香港旅游景及多个商业中心，是商务和休闲旅客的理想下榻之处。旅客不但可步行前往庙街夜市，玉器市场，女人街，维多利亚港及天星码头等多个旅游景点；更可沿弥敦道往尖沙咀方向步行5分钟至九龙区最大的公园-九龙公园。而前往多个大型购物商场如尖沙咀海运大厦、iSQUARE 国际广场、The One 和著名的香港文化中心观看表演或展览也只需步行约10分钟。\n\n酒店位于九龙市中心的 ”黄金地段”，公共运输四通八达，距离港铁（地铁）佐敦站约2分钟步程\n乘搭港铁往返维多利亚港及香港岛只需数分钟。酒店与香港会议展览中心只相隔3个港铁站，车程为大槪10 分钟，方便快捷。\n旅客前往香港国际机场，更可轻松乘搭离酒店不远的A21机场巴士，需时约30分钟。</span>','佐敦弥敦道240-252号立信大厦9字楼A室, 佐敦'),(15,5,172067,'尚酒店','<span lang=\"zh-CN\" tabindex=\"0\">Cozy Hostel旅馆位于尖沙咀的中心地带，毗邻公园，国际广场和b1尖沙咀的豪宅。\n\n舒适旅馆距离维多利亚港不到1公里，距离尖沙咀天星码头有10分钟的步行路程，距离国际广场有1.3公里。这家一星级旅馆的空调客房设有私人浴室和免费无线网络连接。酒店禁止吸烟，距离星光大道有400米。\n\n旅馆的所有客房均配有水壶。 Cozy Hostel旅馆的客房配有带卫星频道的平面电视。\n\n住宿附近的热门景点包括海港城，Mira Place 1和Mira Place 2。\n\n\n油尖旺区是购物，奢侈品牌购物及购物服装的旅客的绝佳选择。</span>',''),(16,7,26846,'美的假日酒店','<p>美的假日酒店是我们的酒店之一。位于弥敦道737号，距离港铁站5分钟路程。</p><p>我们的酒店面积非常大，面积接近3500平方英尺。 我们位于旺角巴士站外的金輪大廈。</p><p>美的假日酒店提供带免费WiFi的空调客房。 这家一星级酒店提供票务服务和旅游咨询台。 酒店禁止吸烟，距离女人街有700米。 免费水和洗浴用品以及可爱的员工。</p><p>酒店距离美丽华商场有2.8公里，距离圆方有3.5公里<span style=\"font-size: inherit;\">。</span></p>','弥敦道737号 金轮大厦 2楼 A-D室'),(17,4,169762,' 宇宙宾馆','<p>宇宙宾馆由Koalabeds(考拉拉)管理，提供覆盖各处的免费WiFi，舒适干净的客房配有平面卫星电视。提供旅游安排和票务服务</p><p>宇宙宾馆是美丽都大厦中最大的宾馆。</p><p>宇宙宾馆距离ISquare国际广场有100米，距离海港城有400米。距离香港国际机场24公里。</p><p>所有空调客房均拥有充足的自然光线，配有办公桌，衣架和电话。私人浴室配有免费洗浴用品和淋浴设施。</p><p>可应要求提供行李寄存服务和保险箱。酒店可提供洗衣服务。</p><p>尖沙咀是对奢侈品牌购物，购物服装和购物感兴趣的旅客的绝佳选择。</p><p>宇宙宾馆由Koalabeds Group(考拉拉集团)管理。</p>','尖沙咀 弥敦道54-64号 美丽都大厦 12 /F F1室（接待处）');
