--
-- Table structure for table `ko_hotel_order`
--

DROP TABLE IF EXISTS `ko_hotel_order`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `ko_hotel_order` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '自增id',
  `openid` varchar(32) DEFAULT NULL COMMENT '订单用户微信openid',
  `propertyID` int(11) NOT NULL COMMENT '酒店id',
  `startDate` date DEFAULT NULL COMMENT '入住日期',
  `endDate` date DEFAULT NULL COMMENT '退房日期',
  `guestFirstName` varchar(64) DEFAULT '' COMMENT '客户名称',
  `guestLastName` varchar(64) DEFAULT '' COMMENT '客户姓',
  `guestCountry` varchar(64) DEFAULT '' COMMENT '客户所在国家编码',
  `guestZip` varchar(32) DEFAULT '' COMMENT '客户邮编',
  `guestEmail` varchar(128) DEFAULT '' COMMENT '客户邮箱',
  `guestPhone` varchar(32) DEFAULT '' COMMENT '客户手机号码',
  `rooms` text COMMENT '预订的房间信息',
  `rooms_roomTypeID` varchar(32) DEFAULT '' COMMENT '预订的房间房型',
  `rooms_quantity` int(11) DEFAULT '0' COMMENT '预订的房间数量',
  `adults` text COMMENT '预订的大人房间信息',
  `adults_roomTypeID` varchar(32) DEFAULT '' COMMENT '预订的大人房间信息',
  `adults_quantity` int(11) DEFAULT '0' COMMENT '预订的大人房间数量',
  `children` text COMMENT '预订的儿童房间信息',
  `children_roomTypeID` varchar(32) DEFAULT '' COMMENT '预订的儿童房间信息',
  `children_quantity` int(11) DEFAULT '0' COMMENT '预订的儿童房间数量',
  `status` int(11) DEFAULT '0' COMMENT '订单状态。0未支付，1已支付，2支付失败，3待确认，4订单取消，5预订失败，6预订成功，7入住，8离店，9不显示',
  `total` varchar(32) DEFAULT NULL COMMENT '总价格',
  `frontend_total` varchar(32) DEFAULT NULL COMMENT '小程序计算的总价格',
  `balance` varchar(32) DEFAULT NULL COMMENT '余款',
  `balanceDetailed` text COMMENT '余款细节',
  `assigned` text COMMENT '分配的酒店房间详情',
  `unassigned` text COMMENT '未分配的酒店房间详情',
  `cardsOnFile` text COMMENT '信用卡信息',
  `reservationID` int(11) DEFAULT NULL COMMENT '预定id',
  `estimatedArrivalTime` time DEFAULT NULL COMMENT '到店时间，24小时制',
  `create_time` int(11) DEFAULT NULL COMMENT '订单生成时间',
  `outTradeNo` varchar(64) DEFAULT NULL COMMENT '订单编号',
  `transaction_id` varchar(64) DEFAULT '' COMMENT '交易单号',
  `transaction_info` text COMMENT '交易详情',
  `coupon_id` int(11) DEFAULT '0' COMMENT '所使用的优惠券id',
  `source_prize` varchar(32) DEFAULT NULL COMMENT 'cloudbeds原价',
  `reservationInfo` text COMMENT '预订信息',
  `rooms_roomTypeName` varchar(255) DEFAULT NULL COMMENT '房间类型名称',
  `rooms_roomTypeDesc` text COMMENT '房间类型描述',
  `rooms_roomTypeImg` varchar(1024) DEFAULT NULL COMMENT '房间类型图片',
  `extinfo` text COMMENT '酒店订单附加信息字段',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=11 DEFAULT CHARSET=utf8 COMMENT='酒店订单表';
/*!40101 SET character_set_client = @saved_cs_client */;

